$(function(){$(".screenshotframe").dialog({autoOpen:!1,draggable:!1,resizable:!1,show:"blind",hide:"blind",speed:"fast",closeOnEscape:!0,width:"auto",height:"auto"});$(".screenshot").click(function(a){a.stopPropagation();showDialog(this.id+"-frame")});$(".screenshotframe").click(function(a){hideDialog(this.id)});$("#main, #projects").tabs({heightStyle:"content",animate:"easeOutCubic"});$(".button").on("click",function(){ga("send","event","button",this.id)})});$(document).ready(function(){drawSkills("skills-boxes")});
function showDialog(a){$("#"+a).dialog("open");$("body").click(function(){hideDialog(a)});ga("send","event","dialog",a)}function hideDialog(a){$("#"+a).dialog("close")}function drawSkills(a){for(var d=[["Java",5],["Scala",4],["Ruby",3],["PHP",3],["C++",2],["JavaScript",4],["Clojure",1],["Perl",1],["Lua",2],["MySQL",5],["PostgreSQL",3],["Redis",2],["MongoDB",3],["Play",3],["Rails",3]],b="",c=0;c<d.length;c++)b+=drawSkill(d[c][0],d[c][1]);$("#"+a).html(b)}
function drawSkill(a,d){for(var b='<div class="skill inline"><div class="skill-name">'+a+'</div><div class="skills-xp">',c=0;5>c;c++)b=d>c?b+'<div class="inline box filled"></div>':b+'<div class="inline box"></div>';return b+"</div></div>"};